// SintaxLexerInit initializes any static state used to implement SintaxLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewSintaxLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func SintaxLexerInit() {
	staticData := &SintaxLexerLexerStaticData
	staticData.once.Do(sintaxlexerLexerInit)
}

// NewSintaxLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewSintaxLexer(input antlr.CharStream) *SintaxLexer {
	SintaxLexerInit()
	l := new(SintaxLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &SintaxLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "Sintax.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

